import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
const root = ReactDOM.createRoot(document.getElementById('root'));

const App = (props) => {
  return <h1>{props.counter}</h1>
}

let counter = 0

ReactDOM.render(
  <React.StrictMode>
    <App counter={counter} />
  </React.StrictMode>
);
